import{_ as e,c as t,o as i,a as o}from"./app.37006fb0.js";const a="data:image/png;base64,",n="data:image/png;base64,",b=JSON.parse(`{"title":"Getting started","description":"","frontmatter":{},"headers":[{"level":2,"title":"Select your organisation","slug":"select-your-organisation","link":"#select-your-organisation","children":[]},{"level":2,"title":"Sign In","slug":"sign-in","link":"#sign-in","children":[]},{"level":2,"title":"Create a club and a competition Level","slug":"create-a-club-and-a-competition-level","link":"#create-a-club-and-a-competition-level","children":[]},{"level":2,"title":"Add a gymnast","slug":"add-a-gymnast","link":"#add-a-gymnast","children":[]},{"level":2,"title":"Create a competition","slug":"create-a-competition","link":"#create-a-competition","children":[{"level":3,"title":"Add a Level","slug":"add-a-level","link":"#add-a-level","children":[]},{"level":3,"title":"Add an Entry","slug":"add-an-entry","link":"#add-an-entry","children":[]},{"level":3,"title":"Create a Session","slug":"create-a-session","link":"#create-a-session","children":[]},{"level":3,"title":"Generate a Work Order","slug":"generate-a-work-order","link":"#generate-a-work-order","children":[]}]},{"level":2,"title":"You're now ready to run the competition","slug":"you-re-now-ready-to-run-the-competition","link":"#you-re-now-ready-to-run-the-competition","children":[]}],"relativePath":"getting-started.md"}`),l={name:"getting-started.md"},r=o('<h1 id="getting-started" tabindex="-1">Getting started <a class="header-anchor" href="#getting-started" aria-hidden="true">#</a></h1><div class="tip custom-block"><p class="custom-block-title">You need an organisation</p><p>If you don&#39;t yet have an RG Scores organisation, please get in touch via our <a href="https://rgscores.com/contact/" target="_blank" rel="noreferrer">Contact page</a> to ask for a free trial.</p></div><h2 id="select-your-organisation" tabindex="-1">Select your organisation <a class="header-anchor" href="#select-your-organisation" aria-hidden="true">#</a></h2><ol><li>Browse to <a href="https://app.rscores.com" target="_blank" rel="noreferrer">https://app.rscores.com</a></li><li>Ensure you have selected your organisation <ol><li>The first time you access RGScores you will be prompted to select an organisation to use</li><li>You can use the <code>Switch To..</code> menu option at any time to select a different organisation.<br><img src="'+a+'" alt="Switching organisations"></li><li>The currently selected organisation is shown above the navigation menu</li></ol></li></ol><h2 id="sign-in" tabindex="-1">Sign In <a class="header-anchor" href="#sign-in" aria-hidden="true">#</a></h2><ol><li>Sign in by clicking on Sign In along the right-hand side of the site header.<br><img src="'+n+'" alt="Sign In"></li><li>Complete the sign-in process using either your Google or Facebook account.</li><li>Once signed, extra navigation menu entries will appear</li></ol><h2 id="create-a-club-and-a-competition-level" tabindex="-1">Create a club and a competition Level <a class="header-anchor" href="#create-a-club-and-a-competition-level" aria-hidden="true">#</a></h2><ol><li>Click on <code>Administration</code> in the navigation menu.</li><li>You will see a <code>Setup</code> card on the page containing links to Clubs, Levels, and System Settings.</li><li>Create a club by clicking on the <code>Clubs</code> link, and then on the (+) button at the top right.</li><li>Enter the name of the club, and click <code>Save</code>.</li></ol><p>Now that a club is created, we need to add a competition level. Levels are used to group Gymnasts together for competition.</p><ol><li>From the Administration page, click on the <code>Levels</code> link in the Setting card.</li><li>Enter the name of the Level.</li><li>Go to the Apparatus tab and select Ball, Hoop, Clubs, and Ribbon.</li><li>Cick <code>Save</code></li></ol><p>See the <a href="./administration/levels.html">Competition Levels</a> page for more information about the different level options.</p><h2 id="add-a-gymnast" tabindex="-1">Add a gymnast <a class="header-anchor" href="#add-a-gymnast" aria-hidden="true">#</a></h2><ol><li>From the Administration page, click on the (+) button within the <code>People</code> card.</li><li>Enter the gymnast&#39;s First and Last names</li><li>Select the club the gymnast belongs to.</li><li>(optional) Enter the birth date of the gymnast. Having dates of birth helps avoid mistakes when entering gymnasts into levels with age restrictions.</li><li>From the person catgeory, ensure you select the &#39;Gymnast&#39; radio button.</li><li>Click <code>Save and Close</code> when done.</li></ol><p>See the <a href="./administration/people.html">People</a> page for more information on adding gymnasts and other people to the system.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Adding many people be a little repetitive, but thankfully it&#39;s a one-time exercise. Once a gymnast is in the system you won&#39;t need to re-enter their details anywhere else.</p></div><h2 id="create-a-competition" tabindex="-1">Create a competition <a class="header-anchor" href="#create-a-competition" aria-hidden="true">#</a></h2><ol><li>Click on <code>Administration</code> in the left hand menu.</li><li>In the <code>Competitions</code> card, click the add (+) button to create a new competition.</li><li>Enter a name for the competition and a start date, then click <code>Save</code>.</li></ol><p>The competition will then be shown in the upcoming list of competitions.</p><p>Select the competition you just created to go to the competition management page.</p><p>This is where you will manage entries, add sessions, and update the competition details.</p><h3 id="add-a-level" tabindex="-1">Add a Level <a class="header-anchor" href="#add-a-level" aria-hidden="true">#</a></h3><p>Let&#39;s start by adding the levels that will be competing at this competition.</p><ol><li>Click on the <code>Edit</code> button in the <code>Settings</code> card.</li><li>In the Competition Levels area, select all of the levels that will be competing. If you&#39;ve been following the Getting Started guide, this will be the level you created earlier.</li><li>Click <code>Save</code></li></ol><h3 id="add-an-entry" tabindex="-1">Add an Entry <a class="header-anchor" href="#add-an-entry" aria-hidden="true">#</a></h3><p>Next up, we need to add an entry.</p><ol><li>In the <code>Entries</code> card, click the <code>Edit Entries</code> button.</li><li>Select a club from the drop down list.</li><li>Expand the Level you wish to add an entry to, and cick the (+) button to add a new entry.</li><li>Select the gymnast you created earlier in the guide, leaving the music tracks empty for now and click <code>Add &amp; Close</code></li><li>Click the <code>&lt;-</code> button at the top of the Entries card to go back to the entry overview.</li></ol><p>Competitions are broken up into sessions, and each competition needs at least one session.</p><h3 id="create-a-session" tabindex="-1">Create a Session <a class="header-anchor" href="#create-a-session" aria-hidden="true">#</a></h3><ol><li>In the <code>Sessions</code> card, click the (+) button to add a new session.</li><li>Enter a session name, and the date for the session. The session date must be one of the days the competition is run on.</li><li>Click <code>Save</code></li><li>Now select the session you just added from the session list.</li><li>In the <code>Settings</code> card, select which levels will be competing in the session. There should just be one if you are following the guide.</li><li>Click <code>Save</code></li></ol><h3 id="generate-a-work-order" tabindex="-1">Generate a Work Order <a class="header-anchor" href="#generate-a-work-order" aria-hidden="true">#</a></h3><p>Now that your session is defined, and you have entries in your competition we can create the Work Order for the session.</p><ol><li>In the <code>Settings</code> card, click the <code>Generate Work Order</code> button.</li><li>Leave the settings as the default values and click <code>Generate</code></li></ol><p>The system will generate all of the routines for the competition and you will now have a competition ready to be run.</p><p>Once your competition is ready, you should then <code>Publish</code> it to make it visible on the home page, and <code>Activate</code> it so that scores can be entered. Activating a competition will use a competition credit.</p><h2 id="you-re-now-ready-to-run-the-competition" tabindex="-1">You&#39;re now ready to run the competition <a class="header-anchor" href="#you-re-now-ready-to-run-the-competition" aria-hidden="true">#</a></h2><p>See the <a href="./running-competitions/">Running Competitions</a> for guidance on score entry, using the scoreboard, using the Floor Marshall option, and viewing results.</p>',36),s=[r];function d(c,h,p,u,g,m){return i(),t("div",null,s)}const A=e(l,[["render",d]]);export{b as __pageData,A as default};
